import math

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def x_or_y(n, x, y):
    if is_prime(n):
        return x
    else:
        return y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return extension.count('A') - extension.count('a')

    strongest = max(extensions, key=strength)
    return f"{class_name}.{strongest}"

def even_odd_count(num):
    even_count = sum(1 for d in str(abs(num)) if int(d) % 2 == 0)
    odd_count = sum(1 for d in str(abs(num)) if int(d) % 2 != 0)
    return (even_count, odd_count)

def int_to_mini_roman(number):
    roman_dict = {1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'}
    values = [1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1]
    result = ''
    for val in values:
        while number >= val:
            result += roman_dict[val]
            number -= val
    return result

def find_max(words):
    def count_unique_chars(word):
        return len(set(word))

    max_unique_chars = 0
    max_word = ''
    for word in words:
        unique_chars = count_unique_chars(word)
        if unique_chars > max_unique_chars or (unique_chars == max_unique_chars and word < max_word):
            max_unique_chars = unique_chars
            max_word = word

    return max_word

def do_algebra(operators, operands):
    expression = str(operands[0])
    for i in range(len(operators)):
        expression += operators[i] + str(operands[i+1])
    return eval(expression)

def solve(s):
    result = ''
    has_letter = False
    for char in s:
        if char.isalpha():
            has_letter = True
            if char.islower():
                result += char.upper()
            else:
                result += char.lower()
        else:
            result += char
    if not has_letter:
        result = result[::-1]
    return result

import hashlib

def string_to_md5(text):
    if text == '':
        return None
    md5_hash = hashlib.md5()
    md5_hash.update(text.encode())
    return md5_hash.hexdigest()
